import dummy from "../Data/Dummy.json"

function MainPage() 
{  
  return (
    <div>
      <table>
        <tbody>
          {dummy.Post.map(data => (
            <tr>
              <td>{data.day} ///// </td>
              <td>{data.ti} ///// </td>
              <td>{data.post} </td>
            </tr>
          ))}
        </tbody>
      </table>  
    </div>
  );

}

export default MainPage;
